// Allow CORS for REST API
add_action('rest_api_init', function () {
    // Log API call
    // error_log('REST API request received: ' . json_encode($_SERVER));
    
    // Set the Access-Control-Allow-Origin header for all REST API responses
    header('Access-Control-Allow-Origin: *');
    header('Access-Control-Allow-Methods: GET, POST, OPTIONS');
    header('Access-Control-Allow-Headers: Content-Type, Authorization');

    // Respond to preflight requests
    if ($_SERVER['REQUEST_METHOD'] === 'OPTIONS') {
        status_header(200);
        exit();
    }
    // Make sure site allows REST API access
    add_filter('rest_authentication_errors', function ($access) {
        return is_wp_error($access) ? $access : true;
    });    
});

// Register REST API route
add_action('rest_api_init', function () {
    register_rest_route('trust-txt/v1', '/generate', array(
        'methods' => array('GET', 'POST', 'OPTIONS'),
        'callback' => 'generate_trust_txt',
        'args' => array(
            'url' => array(
                'required' => true,
                'validate_callback' => function($param, $request, $key) {
                    return filter_var($param, FILTER_VALIDATE_URL);
                }
            )
        ),
    ));
});

// Callback function to validate trust.txt file and referenced entries
function generate_trust_txt($data) {
    $result = [];
    // Fetch webpage
    $url = sanitize_text_field($data['url']);
    $domain = str_ireplace('www.', '', parse_url($url, PHP_URL_HOST));
    $response = wp_remote_get($url);
    $wp_error = is_wp_error($response);
    $status_code = wp_remote_retrieve_response_code($response);
    $status_message = wp_remote_retrieve_response_message($response);
    if ($wp_error == true) {
        $wp_error_message = $response->get_error_message();
        $error_message = ' (' . $status_message . ', ' . $wp_error_message . ')';
    } else {
        $wp_error_message = '';
        $error_message = ' (' . $status_code . ': ' . $status_message . ')';
    }
    if ($wp_error || $status_code != 200) {
        $result[] = "# Unable to access webpage " . $url . $error_message;
        return new WP_REST_Response($result, $status_code);
    } else {
        // Get HTML and parse
        $html = wp_remote_retrieve_body($response);
        $htmlDom = new DOMDocument;
        @$htmlDom->loadHTML($html);
        // Find website name
        $name = find_name($htmlDom);
        // Generate header
        $header = gen_header($name);
        // Extract links
        $links = extract_links($htmlDom);
        // Extract any ecosystem matches
        $ecosys = gen_ecosys();
        $ecosys_matches = [];
        foreach ($ecosys as $tuple) {
            if ((str_contains($tuple['srcurl'], '.' . $domain)) || (str_contains($tuple['refurl'], '.' . $domain))) {
                $ecosys_matches[] = array(
                    'srcurl' => $tuple['srcurl'],
                    'attr' => $tuple['attr'],
                    'refurl' => $tuple['refurl']
                );
            }
        }
        // Find if it belongs to a chain or matches a control entry in ecosystem
        $controlledby = find_chains($name, $domain, $html, $ecosys_matches);
        // Find if it is a member of any associations in ecosystem
        $belongto = find_belongto($name, $domain, $ecosys_matches);
        // Find social links
        $social = find_socials($name, $links);
        // Find contacts
        $contacts = find_contacts($name, $links, $domain);
        // Find vendors
        $vendors = find_vendors($name, $html);
        // Find disclosures
        $disclosures = find_disclosures($name, $links, $domain);
        // Set datatrainingallowed to "no"
        $datatrainingallowed = ["#", "# " . $name . " data training allowed declaration", "#", "datatrainingallowed=no"];
        // Find Copyright
        $copyright = find_copyright($html);
        // Compose result
        $result = array_merge($header, $controlledby, $belongto, $social, $vendors, $contacts, $disclosures, $datatrainingallowed, $copyright);
        // Check to see if nothing is found
        if (count($result) !== 27) {
            return new WP_REST_Response($result, 200);
        } else {
            return new WP_REST_Response($html, 200);
        }
    }
}
// Helper function to extract links from HTML
function extract_links($htmlDom) {
    //Extract the links from the HTML.
    $links = $htmlDom->getElementsByTagName('a');

    //Array that will contain our extracted links.
    $result = [];

    //Loop through the DOMNodeList.
    //We can do this because the DOMNodeList object is traversable.
    foreach($links as $link){

        //Get the link text.
        $linkText = $link->nodeValue;
        //Get the link in the href attribute.
        $linkHref = $link->getAttribute('href');

        //If the link is empty, skip it and don't
        //add it to our $extractedLinks array
        if(strlen(trim($linkHref)) == 0){
            continue;
        }

        //Skip if it is a hashtag / anchor link.
        if($linkHref[0] == '#'){
            continue;
        }

        //Add the link to our $extractedLinks array.
        $result[] =  $linkHref;
    }
    return ($result);
}
// Helper function to extract ecosystem matches
function extract_ecosys($domain, $ecosys) {
    $result = array_filter($ecosys, function ($tuple) {
        return(str_contains($tuple['srcurl'], '.' . $domain) || str_contains($tuple['refurl'], '.' . $domain));
    });
    return($result);
}
// Helper function to find social URLs
function find_socials($name, $links) {
    // This is an array of arrays of strings for identified social networks, the key is the domain of the social network and
    // each array is a list of exception strings for that social network to reject as "social=" entries (queries are always rejected)
    $socials = [
        'facebook.com' => ["?", "facebook.com/people/", "facebook.com/sharer/", "staticxx.facebook.com"],
        'instagram.com' => ["?", "instagram.com/p/", "instagram.com/reel/", "platform.instagram.com"],
        'lipboard.com' => ["?"],
        'linkedin.com' => ["?", "platform.linkedin.com"],
        'newsbreak.com' => ["?"],
        'pinterest.com' => ["?",  "api.pinterest.com", "pinterest.com/pin/create/button/"],
        'post.news' => ["?"],
        'threads.net' => ["?"],
        'twitter.com' => ["?", "platform.twitter.com", "syndication.twitter.com", "twitter.com/intent/"],
        'weibo.com' => ["?"],
        'x.com' => ["?", "platform.x.com", "syndication.x.com", "x.com/intent/"],
        'youtube.com' => ["?"]
    ];
    $result = ["#", "# " . $name . " social networks", "#"];
    $default = count($result);
    $list = [];
    // Scan each link for each social domain
    foreach ($links as $link) {
        foreach ($socials as $key => $social) {
            // $result[] = "# link = " . $link;
            // $result[] = "# social = " . $key;
            if (str_contains($link, $key)) {
                // Check all of the exception strings
                foreach ($socials[$key] as $exception) {
                    // If link contains an exception, skip this link
                    if (str_contains($link, $exception)) {
                        break 3;
                    }
                }
                // If link doesn't end with "/" add it, to avoid multiple entries (one with and one without)
                if (!str_ends_with($link, "/")) {
                    $link = $link . "/";
                }
                // If there are no exceptions, check if not already in list
                if (array_search($link, $list) === false) {
                    $list[] = $link;
                    $result[] = 'social=' . $link;
                }
            }
        }
    }
    if (count($result) === $default) {
        $result[] = "# social=";
    }
    return ($result);
}
// Boolean to string
function bool2string($bool) {
    if ($bool) {
        return ("True");
    } else {
        return ("False");
    }
}
// Helper function to find name of website
function find_name($htmlDom) {
    $nodes = $htmlDom->getElementsByTagName('title');
    $raw_name = $nodes->item(0)->nodeValue;
    $name = trim(preg_replace("/ [\||-] /", " ", preg_replace("/[H|h]ome/", "", preg_replace("/[H|h]ome [P|p]age/", "", $raw_name))));
    // Deal with some unique characters
    $name = str_replace("\u{0080}", "", $name);
    $name = str_replace("\u{0094}", "", $name);
    $name = str_replace("\u{0099}", "", $name);
    // Decode HTML entities
    $name = html_entity_decode($name);
    return ($name);
}
// Helper function to generate header
function gen_header($name) {
    $result = [
    "# ". $name . " trust.txt file",
    "#",
    "# For more information on trust.txt see:",
    "# 1. https://journallist.net - Home of the trust.txt specification",
    "# 2. https://datatracker.ietf.org/doc/html/rfc8615 - IETF RFC 8615 - Well-Known Uniform Resource Identifiers (URIs)",
    "# 3. https://www.iana.org/assignments/well-known-uris/well-known-uris.xhtml - IANA's list of registered Well-Known URIs"
    ];
    return ($result);
}
// Helper function to find website contacts
function find_contacts($name, $links, $domain) {
    $contacts = [
        "/contact-us", 
        "/about-us", 
        "/contact", 
        "/about", 
        "/connect", 
        "/kontakt", 
        "/station-information", 
        "mailto:",
        "tel:"
    ];
    $result = ["#", "# " . $name . " contact info", "#"];
    $default = count($result);
    $list = [];
    // Scan each link for each contact form
    foreach ($links as $link) {
        foreach ($contacts as $contact) {
            // If relative link, prepend with the domain
            if (str_starts_with($link, "/")) {
                $link = "https://www." . $domain . $link;
            }
            // If link begins with "mailto" and contains a "?" skip it
            if (str_starts_with($link, "mailto") && str_contains($link, "?")) {
                break;
            }
            // If link begins with "http" and doesn't end with "/" add it, to avoid multiple entries (one with and one without)
            if (str_starts_with($link, "http") && !str_ends_with($link, "/")) {
                $link = $link . "/";
            }
            // If found add to result if not already in result
            if (str_contains($link, $contact) && str_contains($link, $domain) && (array_search($link, $list) === false)) {
                $list[] = $link;
                $result[] = 'contact=' . $link;
            }
        }
    }
    if (count($result) === $default) {
        $result[] = "# contact=";
    }
    return ($result); 
}
