// Helper function to find disclosures
function find_disclosures ($name, $links, $domain) {
    $disclosures = [
        "privacy",
        "policy", 
        "cookie", 
        "terms"
    ];
    $max_len = strlen("terms-and-conditions") + 2;
    $result = ["#", "# " . $name . " disclosure info", "#"];
    $default = count($result);
    $list = [];
    // Scan each link for each contact form
    foreach ($links as $link) {
        foreach ($disclosures as $disclosure) {
            // If relative link, prepend with the domain
            $base = "https://www." . $domain;
            if (str_starts_with($link, "/")) {
                $link = $base . $link;
            }
            // If link doesn't end with "/" add it, to avoid multiple entries (one with and one without)
            if (!str_ends_with($link, "/")) {
                $link = $link . "/";
            }
            $delta = strlen($link) - strlen($base);
            // If found and not already in result and it contains the domain and if the delta length is less than the maximum
            if (str_contains($link, $domain) && str_contains($link, $disclosure) && (array_search($link, $list) === false) && ($delta < $max_len)) {
                $list[] = $link;
                $result[] = 'disclosure=' . $link;
            }
        }
    }
    if (count($result) === $default) {
        $result[] = "# disclosure=";
    }
    return ($result);
}
// Helper function to find copyright
function find_copyright ($html) {
    $copyright_list = [
        "[C|c]opyright [0-9]{4}", 
        "[C|c]opyright © [0-9]{4}", 
        "[C|c]opyright ©[0-9]{4}", 
        "[C|c]opyright ©",
        "[C|c]opyright (c) [0-9]{4}",
        "&copy; [0-9]{4}",
        "&copy;[0-9]{4}",
        "© [0-9]{4}",
        "©[0-9]{4}", 
        "© [C|c]opyright",
        "&copy;",
        "[C|c]opyright ",
        "©"
    ];
    // Limit length of copyright string to 120 characters.
    $max_len = 120;
    $result = ["#"];
    $found = false;
    foreach ($copyright_list as $copyright_regex) {
        $regex = "/>[^>]*" . $copyright_regex . "[^<]*</";
        if (preg_match($regex, $html, $matches) === 1) {
            foreach ($matches as $match){
                $match = html_entity_decode($match);
                $match = trim(str_replace(">", "", str_replace("<", "", $match)));
                // If length of copyright string is less than maximum use this match, otherwise continue
                if (strlen($match) <= $max_len)
                {
                    $result[] = "# " . $match;
                    $found = true;
                    break;
                }
            }
        }
        // If a copyright match has been found, skip remaining copyright strings
        if ($found) {
            break;
        }
    }
    return ($result);
}
