// Helper function to check ecosystem webcrawl for any association memberships
function find_belongto($name, $domain, $ecosys_matches) {
    $result = ["#", "# " . $name . " belongs to the following organizations", "#"];
    $default = count($result);
    foreach ($ecosys_matches as $tuple) {
        if (($tuple['attr'] === 'member') && str_contains($tuple['refurl'], $domain)) {
            // Only add the entry if it doesn't already appear in the result
            $entry = "belongto=" . $tuple['srcurl'];
            if (array_search($entry, $result) === false) {
                $result[] = $entry;
            }
        }
    }
    // If there aren't any matches, add a belongto= comment
    if (count($result) === $default) {
        $result[] = "# belongto=";
    }
    return ($result);
}
